// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./StakingSXCVault.sol";

contract StakingSXC is Initializable, AccessControlUpgradeable {
    using CountersUpgradeable for CountersUpgradeable.Counter;

    IERC20 public stakingToken;
    IERC20 public sxcToken;
    StakingSXCVault public vault;

    uint256 private _totalStaked;

    mapping(address => uint256) private _stakeOf;
    mapping(address => uint256) private _withdrawnOf;
    mapping(address => uint256) private _creditOf;

    uint256 internal _totalDividend;

    uint256 private _dps;

    uint256 internal constant DPS_ZOOM = 1e18;
    uint256 private _lastSXCBalance;

    event Withdraw(address indexed withdrawer, uint256 amount);
    event Stake(address indexed owner, uint256 amount);
    event UnStake(address indexed owner, uint256 amount);

    function initialize(IERC20 stakingToken_, IERC20 sxcToken_)
        public
        initializer
    {
        __AccessControl_init();

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);

        sxcToken = sxcToken_;
        stakingToken = stakingToken_;
    }

    // ============ PUBLIC ============
    function stake(uint256 amount_) public {
        stakingToken.transferFrom(msg.sender, address(vault), amount_);

        _withdraw(msg.sender);

        _stakeOf[msg.sender] += amount_;
        _totalStaked += amount_;

        _resetCredit(msg.sender);

        emit Stake(msg.sender, amount_);
    }

    function unStake(uint256 amount_) public {
        require(_stakeOf[msg.sender] >= amount_, "insufficient funds");

        vault.transfer(address(stakingToken), msg.sender, amount_);

        _withdraw(msg.sender);

        _stakeOf[msg.sender] -= amount_;
        _totalStaked -= amount_;

        _resetCredit(msg.sender);

        emit UnStake(msg.sender, amount_);
    }

    function withdraw() public {
        _withdraw(msg.sender);
    }

    function updateDps() public {
        _updateDps();
    }

    function setVault(StakingSXCVault _vault)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        vault = _vault;
    }

    // ============ INTERNALS ============

    function _withdrawableOf(address address_, uint256 dps_)
        internal
        view
        returns (uint256)
    {
        return (_stakeOf[address_] * dps_ - _creditOf[address_]) / DPS_ZOOM;
    }

    function _withdraw(address address_) internal {
        _updateDps();
        uint256 amount = _withdrawableOf(address_, _dps);
        if (amount == 0) {
            return;
        }
        _withdrawnOf[address_] += amount;
        _resetCredit(address_);

        _sxcTransfer(address_, amount);

        emit Withdraw(address_, amount);
    }

    function _updateDps() internal {
        if (_totalStaked == 0) {
            return;
        }
        uint256 added = _updateLastBalance();
        if (added > 0) {
            _totalDividend += added;
            _dps += (added * DPS_ZOOM) / _totalStaked;
        }
    }

    function _resetCredit(address address_) internal {
        _creditOf[address_] = _stakeOf[address_] * _dps;
    }

    function _sxcTransfer(address to_, uint256 amount_) internal {
        sxcToken.transfer(to_, amount_);
        _updateLastBalance();
    }

    function _updateLastBalance() internal returns (uint256) {
        uint256 newBalance = _thisSXCBalance();
        if (newBalance == _lastSXCBalance) {
            return 0;
        }
        uint256 added = newBalance > _lastSXCBalance
            ? newBalance - _lastSXCBalance
            : 0;
        _lastSXCBalance = newBalance;
        return added;
    }

    function _getAddedBalance() internal view returns (uint256) {
        uint256 newBalance = _thisSXCBalance();
        if (newBalance == _lastSXCBalance) {
            return 0;
        }
        uint256 added = newBalance > _lastSXCBalance
            ? newBalance - _lastSXCBalance
            : 0;

        return added;
    }

    function _thisSXCBalance() internal view returns (uint256) {
        return sxcToken.balanceOf(address(this));
    }

    // ============ VIEWS ============
    function withdrawnOf(address address_) public view returns (uint256) {
        return _withdrawnOf[address_];
    }

    function creditOf(address address_) public view returns (uint256) {
        return _creditOf[address_];
    }

    function stakedInfo()
        public
        view
        returns (
            uint256,
            uint256,
            uint256,
            uint256
        )
    {
        uint256 myWithdrawable = withdrawableOf(msg.sender);
        return (
            _stakeOf[msg.sender],
            _totalStaked,
            myWithdrawable,
            _withdrawnOf[msg.sender]
        );
    }

    function withdrawableOf(address address_) public view returns (uint256) {
        if (_totalStaked == 0) {
            return 0;
        }
        uint256 added = _getAddedBalance();
        uint256 newDps = _dps + (added * DPS_ZOOM) / _totalStaked;

        return _withdrawableOf(address_, newDps);
    }

    function totalDividend() public view returns (uint256) {
        return _totalDividend;
    }

    // ============ UTILS ============
    modifier onlyNonContract() {
        _onlyNonContract();
        _;
    }

    function _onlyNonContract() internal view {
        require(tx.origin == msg.sender, "Only EOA allowed (temporary)");
    }
}
